  \"2016-11-25T21:06:32.127999\",\n\t\"name\": \"200506-private-school-universe-survey\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Private School Universe Survey, 2005-06
  (PSS 2005-06), is a study that is part of the Private School Universe program. PSS
  2005-06 (http://nces.ed.gov/surveys/pss/) is a cross-sectional survey that collects
  data on private elementary and secondary schools, including religious orientation,
  level of school, length of school year, length of school day, total enrollment (K-12),
  race/ethnicity of students, number of high school graduates, number of teachers
  employed, program emphasis, and existence and type of kindergarten program. The
  study was conducted using mail questionnaires and telephone follow-up of all private
  schools in the United States. The PSS universe consists of a diverse population
  of schools. It includes both schools with a religious orientation (e.g., Catholic,
  Lutheran, or Jewish) and nonsectarian schools with programs ranging from regular
  to special emphasis and special education. The studyufffds unweighted and weighted
  response rates were both 94 percent. Key statistics produced from PSS 2005-06 are
  on the growth of religiously affiliated schools, the number of private high school
  graduates, the length of the school year for various private schools, and the number
  of private school students and teachers.\",\n\t\"license_title\": \"Creative Commons
